function Homepage()  {
    const [data, setData] = useState([{}])
  useEffect(() => {
    fetch("/").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])
    console.log('hello');
}
export default Homepage;
